register.text:
if (viewHolder != null) {
            final View contentView = viewHolder.itemView.findViewById(R.id.text1);
            View leftSwipeBg = viewHolder.itemView.findViewById(R.id.left_swipe_bg);
            View rightSwipeBg = viewHolder.itemView.findViewById(R.id.right_swipe_bg);
            if (Math.abs(contentView.getTranslationX()) == 1080) {
                ObjectAnimator animator = ObjectAnimator.ofFloat(contentView, View.TRANSLATION_X,
                        contentView.getTranslationX(), 0f);
                animator.setDuration(600);
                animator.start();
                animator.addListener(new AnimatorListenerAdapter() {
                    @Override
                    public void onAnimationEnd(Animator animation) {
                        super.onAnimationEnd(animation);
                        contentView.setTag(null);
                    }
                });

                contentView.setTag("");
            }
        }
